const ms = require('ms')

const cursedIMG = "data:image/jpeg;base64,"
const normalIMG = "data:image/jpeg;base64,"


module.exports.run = async (bot, message, args) => {
    await message.delete()
    await bot.editSelf({avatar:cursedIMG})
    message.channel.createMessage("Welcome to the cursed hour!")
    setTimeout(async () => {
        await bot.editSelf({avatar:normalIMG})
        message.channel.createMessage("Cursed hour has ended!")
    }, ms("1h"));
}

module.exports.info = {
    name: "cursed",
    description: "Changes the bots' pfp for 1h",
    category: "Hidden",
    cooldown: "2h"
}